import React, { Component, useState, useEffect, ImageBackground, View, Text } from "react";
import { Grid } from "@material-ui/core";
import Header from "./Header";
import Content from "./Content";
import DisplayHoldings from "./DisplayHoldings.jsx";
import Footer from "./Footer.jsx";
import { createTheme, ThemeProvider } from '@material-ui/core/styles';
import CssBaseline from '@material-ui/core/CssBaseline';
import "./styles.css";

const darkTheme = createTheme({
  palette: {
    type: 'dark',
  },
});

function Home() {
	return (
		<ThemeProvider theme={darkTheme}>
			<CssBaseline/>
			<Grid container direction="column">
				<Grid item>
					<Header />
		        </Grid>

		        {/*<img src={require('./assets/img/milkyway.jpg')} className="photo"/>*/}

		        <ImageBackground source={require('./assets/img/milkyway.jpg')} style={{width: '100%', height: '100%'}}>
		           <View style={{position: 'absolute', top: 0, left: 0, right: 0, bottom: 0, justifyContent: 'center', alignItems: 'center'}}>
		             <Text>Centered text</Text>
		           </View>
		        </ImageBackground>

		        <br></br>

		        <Grid item container>
		        	<Grid item xs={false} sm={2} />
	        		<Grid item xs={12} sm={8}>
	        			<Content />
    				</Grid>
    				<Grid item xs={false} sm={2} />
		        </Grid>
		    </Grid>
		</ThemeProvider>
	);
}

export default Home;
